import React from 'react';
import './defaulttable.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse, faDisplay, faGear } from '@fortawesome/free-solid-svg-icons';

const TestHeader = () => {
  return (
    <thead>
      <tr className="table-header-bg">
            <th><input type="checkbox" /></th>
            <th classNsame="table-bg">
              <div className="text-center">Call sign</div>
            </th>
            <th classNsame="table-bg">Operation
            <FontAwesomeIcon icon={faHouse} className='fa-sm' />
            </th>
            <th>Date Time</th>
            <th>Location</th>
            <th>Vehicle</th>
            <th>Purpose</th>
            <th>Status</th>
            <th>...</th>
            <th>...</th>
            <th>...</th>
            <th>詳細</th>
          </tr>
    </thead>
  )
}

class DefaultTable extends React.Component {
  render() {
    return (
      <div>
        <TestHeader />
      </div>
    );
  }
}

export default DefaultTable;
